import React, { useState } from "react";
import Repository from "./Repository";



const Repositories = props => {

    return(
        <div>
        { props.repositories.map((repository , index) => {
            return (
            <div key= { index }>
                <h2> { repository.name }</h2>
                <button onClick = { props.getCommits(repository.commits_url.slice(0, -6)) } >See commits</button>
                <Repository commit = { props.commits }/>
                { console.log(props)}
                <a href= { repository.link } >See on Github</a>
            </div>
            )})
        }
        </div>
    )
}


export default Repositories
